(4, 'FIFA 23', 'img_fifa.jpg', 'По результатам теста кроссплатформенной игры в сетевых товарищеских матчах и онлайн-сезонах FIFA 22, мы распространяем кроссплатформенную игру и на другие режимы FIFA 23, а также увеличиваем количество охваченных платформ. В FIFA 23, кроссплатформенная игра будет доступна игрокам, играющим на платформах одного поколения. Версии FIFA 23 для PlayStation®5, Xbox Series X|S, Stadia и ПК будут обладать взаимной совместимостью для кроссплатформенной игры, а версии FIFA 23 для PlayStation®4 и Xbox One будут совместимы для кроссплатформенной игры друг с другом.\n\nВ FIFA 23 кроссплатформенная игра будет доступна в момент выхода игры в FUT Division Rivals (кроме кооп-режима), FUT Champions, FUT Ultimate Online Draft, сетевых товарищеских матчах FUT (кроме кооп-режима), FUT: Игра с другом, сетевых товарищеских матчах, онлайн-сезонах (кроме кооп-сезонов) и киберспортивном режиме Virtual Bundesliga, доступном игрокам из Германии. При первом запуске FIFA 23 функционал кроссплатформенной игры будет включён для всех игроков, при условии, что настройки уровня платформы это позволяют. Кроссплатформенную игру можно отключить в любой момент (подробнее об этом ниже).\n\nМы хотим, чтобы все нововведения появлялись в игре с максимально возможным качеством, поэтому из-за технических тонкостей внедрения кроссплатформенной игры, в таких режимах совместной игры как Клубы профи в настоящий момент кроссплатформенная игра доступна не будет. Мы следим за отзывами сообщества и будем сообщать о всех изменениях, обновлениях и корректировках кроссплатформенной игры @EAFIFADirect по мере их появления.\n\nПримечание: не исключена ситуация, при которой доступность кроссплатформенной игры будет разниться от платформы к платформе в зависимости от проводимых работ, серверных релизов, игровых обновлений, времени непредвиденного простоя или обновлений подбора соперников.С расширением кроссплатформенной игры в FIFA 23 на трансферном рынке FUT появится новая группировка по платформам — о ней мы расскажем ниже в этом материале.\n\nКроме того, мы планируем внедрение нового социального виджета под названием EA Social. EA Social станет своеобразным мостиком между платформами в кроссплатформенной игре, а также упростит игрокам поиск, добавление и игру в кроссплатформенной игре и с друзьями с других платформ.\n\nДавайте перейдём к подробному рассмотрению кроссплатформенной игры.Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed ac pharetra ligula, ut varius ipsum. Aenean sollicitudin efficitur ante ac tincidunt. Nunc justo tellus, convallis ac purus et, ultricies tincidunt nulla. Vivamus faucibus vulputate lorem ac elementum. Integer ullamcorper urna et sapien pulvinar, non posuere felis congue. Aliquam vitae eros id lorem pharetra pharetra vel luctus sem. Interdum et malesuada fames ac ante ipsum primis in faucibus. Integer molestie egestas augue a sollicitudin.\n\nAliquam sed dapibus erat. Nullam maximus, diam id scelerisque convallis, sapien ligula ultrices magna, id rhoncus lacus purus eu ligula. Vestibulum pulvinar vel lacus at consequat. Vestibulum nec arcu sapien. Nulla vestibulum sodales cursus. Integer sollicitudin sed elit nec feugiat. Maecenas finibus sapien diam, in dignissim mi varius venenatis. Suspendisse eu elementum sapien, quis semper elit. Curabitur dignissim condimentum tincidunt. Nullam et fringilla ligula. Etiam elit erat, aliquet non aliquam et, accumsan vel nunc. Nulla non posuere augue.\n\nMorbi dolor tortor, consequat eu viverra vitae, pretium ac nisl. Pellentesque nec pharetra elit. Donec at lorem facilisis, tristique dolor placerat, tincidunt augue. Vivamus bibendum placerat magna sit amet consectetur. Vivamus elit elit, malesuada ac lacus ultricies, maximus pulvinar nibh. Maecenas nisi turpis, accumsan non pharetra tempor, ullamcorper in enim. Duis non imperdiet mi. Ut laoreet orci et leo mollis, ut vestibulum sapien pellentesque. Pellentesque at nisi libero. Cras non efficitur eros.\n\nPraesent posuere ma